import { Box, Grid, GridItem, Heading, Text } from "@chakra-ui/layout";

const NotFound = () => {
  return (
    <Box margin="auto" color="teal">
      <Heading>Error 404.</Heading>
      <Text>The directory you are in is not found.</Text>
    </Box>
  );
};

export default NotFound;
